/*
drop table categories_tab;
drop table customers;
drop table orders;
drop table order_items;
drop table products;
drop table product_information;
*/


create table categories_tab(
    category_name varchar(50) not null,
    category_description varchar(255) not null,
    category_id int not null,
    parent_category_id int
);


create table customers(
    customer_id number(3) not null,
    cust_first_name varchar(50),
    cust_last_name varchar(50),
    nls_territory varchar(50),
    credit_limit number(5),
    cust_email varchar(50),
    account_mgr_id number(3),
    date_of_birth date,
    marital_status varchar(10),
    gender varchar(1),
    income_level varchar(50)
);


create table orders(
    order_id number(4) not null,
    order_date varchar(30) not null,
    order_mode varchar(6) not null,
    customer_id number(3) not null,
    order_status number(2) not null,
    order_total number(10, 1) not null,
    sales_rep_id number(3),
    promotion_id varchar(2)
);


create table order_items(
    order_id number(4) not null,
    line_item_id number(4) not null,
    product_id number(4) not null,
    unit_price number(6, 2) not null,
    quantity number(4) not null
);


create table product_information(
    product_id number(4) not null,
    product_name varchar(50) not null,
    product_description varchar(2000) not null,
    category_id number(4) not null,
    weight_class number(4),
    warranty_period number(4),
    supplier_id number(6),
    product_status varchar(50),
    list_price number(8, 2),
    min_price number(8, 2),
    catalog_url varchar(2000)
);
